  false,\n\t\"url\": null,\n\t\"notes\": \"Data and information collected by the submersible
  Johnson Sea-Link II at waypoints along its track during one dive of the 2002 \"Islands
  in the Stream - Pharmaceutical Discovery, Vision, and Bioluminescence\" expedition
  sponsored by the National Oceanic and Atmospheric Administration (NOAA) Office of
  Ocean Exploration, August 15 - 31, 2002. Measurements and information include sub's
  position and depth; personnel assignments; dive, mission, target, and vehicle ID's;
  dive comments; hyperlinks to CTD plots; water temperature; and salinity. The Marine
  Operations Division of the Harbor Branch Oceanographic Institution provided the
  original submersible data. Quality assurance included a comparsion and synchronization
  of dive log waypoint depths and CTD depths, review of minimum and maximum values,
  and deletion of bad values.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
